import { NavLink } from "react-router-dom";
import './Navbar.css'

export const Navbar = () => {
    return (
        // <nav class="navbar navbar-expand-lg navbar-light bg-light">
        //     <div>
        //         <NavLink to="/">
        //             Home
        //         </NavLink>
        //         <NavLink to="/about">
        //             Test
        //         </NavLink>
        //     </div>
        // </nav>
        <nav>
            <a>IOT Dashboard</a>
            <div id="navbarNav">
                <ul className="navbar-nav">
                <li><NavLink to="/">Home</NavLink></li>
                <li><NavLink to="/about">About</NavLink></li>
                </ul>
            </div>
        </nav>
    )
}
